import React from 'react';
import { useState } from "react";
import "./styles/app.css";

function App() {
  const {text, setText} = useState("");

  const onChangeInput = (e: React.ChangeEvent<HTMLInputElement>) => {
    setText(e.target.value);
  }

  return (
    <div className="App">
     <h1>Todo</h1>
     <input 
        value={text}
        onChange={onChangeInput}
      />
    </div>
  );
}

export default App;
